import React from "react";
import "../css/Projects.css";

const projects = [
  { title: "Aplikasi Inventory", description: "Website berbasis React Js dan Node.js yang mana website berisi informasi pemilik website.", link: "#" },
  { title: "OpenMusic API", description: "Backend API dengan fitur manajemen playlist kolaboratif untuk layanan musik online.", link: "#" },
];

const Projects = () => {
  return (
    <section id="projects">
      <h2>Proyek Website</h2>
      <div className="projects-container">
        {projects.map((project) => (
          <div className="project-card" key={project.id}>
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <a href={project.link} className="project-link">Lihat Detial Proyek</a>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
